function claim (
      address claimer,
      uint256 total,
      uint256 toClaim,
      bytes32[] memory proof
    )
      public
    {
      require (
        _verify(claimer, total, proof),
        'Incorrect merkle proof'
      );
      require (
        toClaim <= (total - claimed[claimer]),
        'Not claimable'
      );
      _disburse (claimer, toClaim);
      claimed[claimer] += toClaim;
      emit Claimed (claimer, toClaim);
    }

